import { Injectable } from "@angular/core";

@Injectable()
export class BasicItem {
  name: string;
  pngString: string;


  constructor(name: string) {
    this.name = name;
    this.pngString = this.getPngString();
  }

  getPngString(){
    let pngString = '';

    switch (this.name) {
      case 'wall':
        pngString = 'Wall'
        break;
      case 'empty':
        break;
      case 'gold':
        pngString = 'Gold'
        break;
      case 'strengthBoost':
        pngString = 'Attackboost'
        break;
      case 'healthBoost':
        pngString = 'HPBoost'
        break;
      case 'manaBoost':
        pngString = 'MPBoost'
        break;
      case 'healthPotion':
        pngString = 'HealthPotion'
        break;
      case 'manaPotion':
        pngString = 'ManaPotion'
        break;
      default:
        break;
    }



    return pngString;
  }

}
